import React from 'react'
import {ChakraProvider, Container, Box, Stack, Divider, Text } from '@chakra-ui/react'

const Feed = () => {
    const mystyle = {
        borderLeft: "6px solid green",
        borderRight: "6px solid green",
        color: "black",
        backgroundColor: "DodgerBlue",
        padding: "10px",
        fontFamily: "Arial"
      };

    return (
        <ChakraProvider>
            <Box style={mystyle}  w="600px" h="100vh" bg="tomato">
                <Text>sasasas</Text>
            </Box>
        </ChakraProvider>
    )
}

export default Feed
